import React from 'react';
import Card from './Card';

function CardList({ dogs, cats }) {

	const pets = dogs.map((dog, i) => {
		return <Card img={dog[i].img} name={dog[i].name} description={dog[i].description}/>
	})
	return (
		<div>
			{pets}
		</div>
	);
}

export default CardList;
